    "op": "and",
    "args": [
        {
            "op": "eq",
            "args": [
                {"property": "Collection/Name"},
                "SENTINEL-2"
            ]
        },
        {
            "op": "eq",
            "args": [
                {"property": "productType"},
                "S2MSI1C"
            ]
        },
        {
            "op": "s_intersects",
            "args": [
                {"property": "geometry"},
                {
                    "type": "Polygon",
                    "coordinates": [
                        [
                            [-11, 35],
                            [27.5, 35],
                            [27.5, 60],
                            [-11, 60],
                            [-11, 35],
                        ]
                    ],
                },
            ],
        }
    ],
}

# Now query the OData Catalog via HTTP

data = http_invoke(base_url, cql2_filter)

# manipulate resulting data

print(json.dumps(data, indent=2))
